`,readingTime:{minutes:.03,words:8},title:"",type:"article",s:"ch17-06-futures-tasks-threads"}}],["/ch18-00-oop.html",{loader:()=>ue(()=>import("./ch18-00-oop.html-DnDLk3kB.js"),[]),meta:{excerpt:`
<blockquote>
